  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:06.529274\",\n\t\"name\": \"agassiz-national-wildlife-refuge-annual-narrative-report-calendar-year-1984\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Agassiz
  National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  compliance with environmental and cultural resource mandates and research and investigations.
  Refuge administration is outlined; information about personnel, manpower programs,
  volunteer programs, funding, safety, and technical assistance is given. Habitat
  management is also covered; subjects include wetlands, forests, croplands, fire
  management, and pest control. The wildlife section of the report discusses wildlife
  diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, game mammals, animal control, marking and bird banding, and
  disease control. The public uses of the Refuge described in this report include
  outdoor classrooms, interpretive programs, hunting, trapping, wildlife observation,
  and law enforcement. The equipment and facilities section of the report provides
  information about new construction, rehabilitation, major maintenance, equipment
  replacement, and energy conservation. Cooperative programs and items of interest
  are provided at the end. Refuge brochures and field guides are attached.\",\n\t\"license_title\":
